/* stylelint-disable */
import React, { useState, useEffect, useCallback } from 'react';
import { render } from 'react-dom';

import { SuggestionButtonType } from '../typings';

const assistantSphereIcon =
    'data:image/png;base64,';

export interface NativePanelParams {
    defaultText: string;
    render?: (props: NativePanelProps) => void;
    tabIndex?: number;
}

interface NativePanelProps extends NativePanelParams {
    defaultText: string;
    sendText: (text: string) => void;
    className?: string;
    tabIndex?: number;
    suggestions: SuggestionButtonType[];
    bubbleText: string;
    onListen: () => void;
    onSubscribeListenStatus: (cb: (type: 'listen' | 'stopped') => void) => () => void;
    onSubscribeHypotesis: (cb: (hypotesis: string, last: boolean) => void) => () => void;
}

export const NativePanel: React.FC<NativePanelProps> = ({
    defaultText,
    sendText,
    className,
    tabIndex,
    suggestions,
    bubbleText,
    onListen,
    onSubscribeListenStatus,
    onSubscribeHypotesis,
}) => {
    const [value, setValue] = useState(defaultText);
    const [recording, setRecording] = useState(false);
    const [bubble, setBubble] = useState(bubbleText);
    const [prevBubbleText, setPrevBubbleText] = useState(bubbleText);
    const [isVisibleInputTouch, setIsVisibleInputTouch] = useState(false);

    if (bubbleText !== prevBubbleText) {
        setPrevBubbleText(bubbleText);
        setBubble(bubbleText);
    }

    const handleSphereClick = useCallback(() => {
        setValue('');
        onListen();
    }, [onListen]);

    const handleClickKeyboard = () => {
        setIsVisibleInputTouch(!isVisibleInputTouch);
    };

    const createSuggestClickHandler = (suggest: SuggestionButtonType) => () => {
        const { action } = suggest;

        if ('text' in action) {
            sendText(action.text);
        }
    };

    useEffect(() => {
        const unsubscribeStatus = onSubscribeListenStatus((type: 'listen' | 'stopped') => {
            setRecording(type === 'listen');
        });

        const unsubscribeHypotesis = onSubscribeHypotesis((hypotesis: string, last: boolean) => {
            setValue(last ? '' : hypotesis);
        });

        return () => {
            unsubscribeStatus();
            unsubscribeHypotesis();
        };
    }, [onSubscribeListenStatus, onSubscribeHypotesis]);

    return (
        <div className={`nativePanel ${className ?? ''} ${isVisibleInputTouch ? ' keyboard-visible' : ''}`}>
            {bubble && (
                <div className="bubble" onClick={() => setBubble('')}>
                    {bubble}
                </div>
            )}

            <div
                className={recording ? 'sphere active' : 'sphere'}
                onClick={handleSphereClick}
                style={{
                    backgroundImage: `url(${assistantSphereIcon})`,
                }}
            />

            <div className="keyboard-touch" onClick={handleClickKeyboard}>
                &#9000;
            </div>

            <input
                id="voice"
                value={value}
                onChange={(e) => {
                    setValue(e.currentTarget.value);
                }}
                tabIndex={typeof tabIndex === 'number' && Number.isInteger(tabIndex) ? tabIndex : -1}
                disabled={recording}
                onKeyDown={(e) => {
                    if (e.key === 'Enter') {
                        sendText(value);
                        setValue('');
                    }
                }}
                className="input"
            />
            <div className="suggestPanel">
                {suggestions.map((s: SuggestionButtonType) => (
                    <div key={`suggest-${s.title}`} onClick={createSuggestClickHandler(s)} className="suggest">
                        {s.title}
                    </div>
                ))}
            </div>
        </div>
    );
};

let div: HTMLDivElement | void;

export const renderNativePanel = (props: NativePanelProps) => {
    if (!div) {
        div = document.createElement('div');
        document.body.appendChild(div);
    }

    render(<NativePanel {...props} />, div);
};

// стили
const NativePanelStyles = `
@keyframes rotation {
    0% {
        transform: rotate(0deg);
    }
    100% {
        transform: rotate(360deg);
    }
}

.nativePanel {
    backdrop-filter: blur(5px);
    box-sizing: border-box;
    display: flex;
    align-items: center;
    position: fixed;
    z-index: 999;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 9rem;
    padding: 2rem 3rem;
    background: linear-gradient(#ffffff00, #000000);
}

.bubble {
    cursor: pointer;
    position: absolute;
    bottom: calc(100% - 1.5rem);
    left: 1rem;
    max-width: 80%;
    border-radius: 0.2rem;
    background-color: rgba(255, 255, 255, 0.08);
    padding: 0.3rem;
    line-height: 24px;
    font-weight: 500;
    color: #fff;
    z-index: -1;
}

.sphere {
    background-size: contain;
    background-repeat: no-repeat;
    padding: 2.2rem;
    transition: transform 0.2s;
    background-position: center;
}

.keyboard-touch {
    display: none;
}

.sphere:hover {
    transform: scale(1.1);
}

.sphere.active {
    animation: rotation 2s linear infinite;
}

.input {
    font-size: 36px;
    line-height: 42px;
    font-weight: 500;
    color: #fff;
    height: 42px;
    padding: 0;
    margin-left: 2rem;
    outline: none;
    border: 0;
    background: transparent;
    width: 80%;
}

.suggestPanel {
    position: absolute;
    bottom: calc(100% - 1.5rem);
    right: 3rem;
    display: flex;
    flex-direction: row;
    height: 28px;
}

.suggest {
    line-height: 26px;
    padding: 0 15px;
    margin-left: 5px;
    border: 1px solid #c4c4c4;
    border-radius: 16px;
    color: #fff;
    cursor: pointer;
    font-size: 14px;
}

@media screen and (max-width: 900px) {
    .input {
        display: none;
    }

    .sphere {
        margin: 0 auto;
    }

    .suggestPanel {
        bottom: calc(100% - 3rem);
    }

    .keyboard-touch {
        position: absolute;
        display: block;
        color: rgba(197, 197, 197, 0.8);
        font-size: 1.5rem;
        right: calc(3rem);
    }

    .keyboard-visible .sphere {
        display: none;
    }

    .keyboard-visible .input {
        display: block;
        margin-left: 0rem;
        background: rgb(144, 144, 144, 0.15);
        border-radius: 1rem;
    }
}
`;

const style = document.createElement('style');
style.appendChild(document.createTextNode(NativePanelStyles));
document.getElementsByTagName('head')[0].appendChild(style);
